struct Conv {

  Activation y;
  Activation x;
  Filter w;

  ///////////////////////////////////////////////////

  ///////////////////////////////////////////////////
  int64_t groups = 1;
  int64_t padding_front = 0;
  int64_t padding_back = 0;
  int64_t padding_top = 0;
  int64_t padding_bottom = 0;
  int64_t padding_left = 0;
  int64_t padding_right = 0;
  int64_t stride_depth = 1;
  int64_t stride_height = 1;
  int64_t stride_width = 1;
  int64_t dilation_depth = 1;
  int64_t dilation_height = 1;
  int64_t dilation_width = 1;
  bool is_xcorrelation = false;

cask::Error isConsistent() const {
   
    if (!(y.batches == x.batches)) {
      return cask::Error::SIZE_MISMATCH;
    }
  
    if (!(y.channels == w.filters)) {
      return cask::Error::SIZE_MISMATCH;
    }
  
    if (!(y.depth == 1 + ((x.depth + padding_front + padding_back - (dilation_depth * (w.depth - 1) + 1))/stride_depth))) {
      return cask::Error::SIZE_MISMATCH;
    }
  
    if (!(y.height == 1 + ((x.height + padding_top + padding_bottom - (dilation_height * (w.height - 1) + 1))/stride_height))) {
      return cask::Error::SIZE_MISMATCH;
    }
  
    if (!(y.width == 1 + ((x.width + padding_right + padding_left - (dilation_width * (w.width - 1) + 1))/stride_width))) {
      return cask::Error::SIZE_MISMATCH;
    }
  
    if (!(w.channels == (x.channels/groups))) {
      return cask::Error::SIZE_MISMATCH;
    }
  
    if (!(y.channels % groups == 0)) {
      return cask::Error::SIZE_MISMATCH;
    }
  
    if (!(x.channels % groups == 0)) {
      return cask::Error::SIZE_MISMATCH;
    }
  

   return cask::Error::OK;
}
};

